import React from "react";

const PromotionList = ({ loading, promotion})=>{
    if(loading){
         <div> Carregando </div>
    }
    return(
        <div className="promotion-list">
            {promotion.map((promotion)=>(
                <PromotionCard promotion={promotion}/>
            
            ))}
        </div>
    )
}

export default PromotionList
